/** 2.10 Working with HTML classes
 * 
 * Let's start practicing simple things, like classes and styles.
 * Under the labs/a6 folder, create another folder called classes and create
 * the following component and styling files.
 */

import React from 'react';
import './index.css';

function Classes() {
    const color = 'blue';
    const dangerous = true;
    // const dangerous = false;

    return (
        <div>
            <h2>Classes</h2>
            <div className={`${dangerous ? 'wd-bg-red' : 'wd-bg-green'} wd-fg-black wd-padding-10px`}>
                Dangerous background</div>

            <div className={`wd-bg-${color} wd-fg-black wd-padding-10px`}>
                Dynamic Blue background</div>

            <div className="wd-bg-yellow wd-fg-black wd-padding-10px">
                Yellow background
            </div>
            <div className="wd-bg-blue wd-fg-black wd-padding-10px">
                Blue background
            </div>
            <div className="wd-bg-red wd-fg-black wd-padding-10px">
                Red background
            </div>
        </div>
    )
};
export default Classes;
